import React, { Component } from 'react';
import 'tachyons';




class TaskList extends Component
{

	render()
	{
		return (
			<div>
				<h1 className=" heading">TASKS</h1>
				<input type="submit" value="+ Add a Task" />
				<ul>
					<li><input type="checkbox" value="Task 1"/></li>
				</ul>
			</div>
		);
	}
}

export default TaskList;
